import React from "react";

const CityContext = React.createContext();

const CityContextProvider = (props) => {
  const [cityDetails, SetCityDetails] = useState({
    city_id: "",
    city_name: "",
    lat: "",
    long: ""
  });

  return
}


export default CityContextProvider;
